/*Table structure for table `gtfw_key_text` */

DROP TABLE IF EXISTS `gtfw_key_text`;

CREATE TABLE `gtfw_key_text` (
  `key_text_key_id` bigint(20) NOT NULL COMMENT 'refer to gtfw_key.key_id',
  `key_text_lang_code` varchar(5) NOT NULL COMMENT 'refer to gtfw_lang.lang_code',
  `key_text_key_text` text,
  `insert_user_id` bigint(20) DEFAULT NULL,
  `insert_timestamp` datetime DEFAULT '0000-00-00 00:00:00',
  `update_user_id` bigint(20) DEFAULT NULL,
  `update_timestamp` datetime DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`key_text_key_id`,`key_text_lang_code`),
  KEY `FK_gtfw_key_text_lang` (`key_text_lang_code`),
  KEY `idx_gtfw_key_text` (`key_text_key_id`),
  CONSTRAINT `fk_gtfw_key_text` FOREIGN KEY (`key_text_key_id`) REFERENCES `gtfw_key` (`key_id`) ON UPDATE CASCADE,
  CONSTRAINT `fk_gtfw_key_text_0` FOREIGN KEY (`key_text_lang_code`) REFERENCES `gtfw_lang` (`lang_code`) ON UPDATE CASCADE
