/*Table structure for table `ref_kategori_wawancara` */

DROP TABLE IF EXISTS `ref_kategori_wawancara`;

CREATE TABLE `ref_kategori_wawancara` (
  `kategoriwawancara_id` int(11) NOT NULL AUTO_INCREMENT,
  `kategoriwawancara_name` varchar(255) DEFAULT NULL,
  `kategoriwawancara_bobot` decimal(4,2) DEFAULT NULL,
  `insert_user_id` bigint(20) DEFAULT NULL,
  `insert_timestamp` datetime DEFAULT NULL,
  `update_user_id` bigint(20) DEFAULT NULL,
  `update_timestamp` datetime DEFAULT NULL,
  PRIMARY KEY (`kategoriwawancara_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;

